const AboutScreen =()=>{
    return(
        <div className={style.aboutContainer}>
        <h2 className={style.aboutTitle}>Welcome!</h2>
        <h3 className={style.SubTitle}>Portfolio of Adrian Colter</h3>
        <p className={style.homePara}></p>
    </div>
    )
}
export default AboutScreen;
